  return (
    <div className="intro-section">
      <img src="path/to/cover-image.jpg" alt="Cover" />
      <h1>RoomSense</h1>
      <p>Your one-line project description</p>
      <a href="URL_TO_YOUR_DEPLOYED_PROJECT" className="button">View Project</a>
    </div>
  );
}

export default IntroSection;
